    async Task<bool> MarksEligibilityCheckAgainAsync()
    {
        bool IsEligible = true;
        try
        {
            if (ShowOptions == "B_Ed")
            {
                if (model.GradutionPassingYear != "Appearing")
                {
                    if (!string.IsNullOrEmpty(model.GradutionPercentageMarks))
                    {
                        if (model.Category.ToLower() == "Unreserved General".ToLower())
                        {
                            if (int.Parse(model.GradutionPercentageMarks) >= 50)
                            {
                                IsEligible = true;
                            }
                            else
                            {
                                if (!string.IsNullOrEmpty(model.PGradutionPercentageMarks))
                                {
                                    if (int.Parse(model.PGradutionPercentageMarks) >= 50 || model.PGradutionPassingYear == "Appearing")
                                    {
                                        IsEligible = true;
                                    }
                                    else
                                    {
                                        IsEligible = false;
                                        await ToastObjRegistration.Show(new ToastModel
                                        {
                                            Title = "Error!",
                                            Content = "You are not eligible, because your graduation or post graduation marks percentage is less than 50%!",
                                            CssClass = "e-toast-danger",
                                            Icon = "e-error toast-icons"
                                        });
                                    }
                                }
                                else
                                {
                                    IsEligible = false;
                                    await ToastObjRegistration.Show(new ToastModel
                                    {
                                        Title = "Error!",
                                        Content = "You are not eligible, because your graduation marks percentage is less than 50%!",
                                        CssClass = "e-toast-danger",
                                        Icon = "e-error toast-icons"
                                    });
                                }
                            }
                        }
                        else
                        {
                            if (int.Parse(model.GradutionPercentageMarks) >= 45)
                            {
                                IsEligible = true;
                            }
                            else
                            {
                                if (!string.IsNullOrEmpty(model.PGradutionPercentageMarks))
                                {
                                    if (int.Parse(model.PGradutionPercentageMarks) >= 45)
                                    {
                                        IsEligible = true;
                                    }
                                    else
                                    {
                                        IsEligible = false;
                                        await ToastObjRegistration.Show(new ToastModel
                                        {
                                            Title = "Error!",
                                            Content = "You are not eligible, because your graduation or post graduation marks percentage is less than 45%!",
                                            CssClass = "e-toast-danger",
                                            Icon = "e-error toast-icons"
                                        });
                                    }
                                }
                                else
                                {
                                    IsEligible = false;
                                    await ToastObjRegistration.Show(new ToastModel
                                    {
                                        Title = "Error!",
                                        Content = "You are not eligible, because your graduation marks percentage is less than 45%!",
                                        CssClass = "e-toast-danger",
                                        Icon = "e-error toast-icons"
                                    });
                                }
                            }
                        }
                    }
                }
                else
                {
                    IsEligible = true;
                }
            }
            else
            {

                IsEligible = true;
            }
        }
        catch (Exception ex)
        {
            if (ShowOptions == "B_Ed")
            {
                await ToastObjRegistration.Show(new ToastModel
                {
                    Title = "Error!",
                    Content = ex.Message,
                    CssClass = "e-toast-danger",
                    Icon = "e-error toast-icons"
                });
                NavigationManager.NavigateTo("RegistrationForm/B_Ed", true);
            }
            else
            {
                await ToastObjRegistration.Show(new ToastModel
                {
                    Title = "Error!",
                    Content = ex.Message,
                    CssClass = "e-toast-danger",
                    Icon = "e-error toast-icons"
                });
                NavigationManager.NavigateTo("RegistrationForm/M_Ed", true);
            }
        }

        return IsEligible;
    }

    public async Task<string> FileUploadMethodAsync(IFormFile Photo, string PhotoPath)
    {
        string uniqueFileName = null;
        if (Photo != null)
        {
            string folderPath = Path.Combine(hostingEnvironment.WebRootPath, PhotoPath);
            uniqueFileName = Guid.NewGuid().ToString() + "_" + Photo.FileName;
            string filePath = Path.Combine(folderPath, uniqueFileName);
            using (var fileStream = new FileStream(filePath, FileMode.Create))
            {
                await Photo.CopyToAsync(fileStream);
            }
        }

        return uniqueFileName;
    }

